function printMap( map, scr, img, context ){
	var i, j;
	var si = Math.round( (scr.y+240) / 30 ) - 10;
	var sj = Math.round( (scr.x+360) / 30 ) - 14;
	for( i = si; i <= si + 16 + 4; i++ ){
		if( i < 1 ) continue;
		for( j = sj; j <= sj + 24 + 4; j++ ){
			if( j < 1 ) continue;
			
			if( map[i][j] == 1 ){
				context.drawImage( img.tile, 0, 0, 30, 30, (j-1)*30-scr.x, (i-1)*30-scr.y, 30, 30 );
			}
			if( map[i][j] == 2 ){
				context.drawImage( img.tile, 30, 0, 30, 30, (j-1)*30-scr.x, (i-1)*30-scr.y, 30, 30 );
			}
		}
	}
};

function makeMap( map, dbmap, enemy ){
	var i, j, k, l;
	
	map[0] = new Object();
	map[0].width = 9;
	map[0].height = 5;
	
	var rmap = new Array();
	for( i = 0; i <= map[0].height + 1; i++ ){
		rmap[i] = new Array();
	}
	
	for( i = 1; i <= map[0].height; i++ ){
		for( j = 1; j <= map[0].width; j++ ){
			rmap[i][j] = Math.floor( Math.random()*11 ) + 2;
			
			if( j == 1 ){
				rmap[i][j] = Math.floor( Math.random()*2 ) + 31;
			}
			if( j == map[0].width ){
				rmap[i][j] = Math.floor( Math.random()*2 ) + 36;
			}
			if( i == 1 ){
				rmap[i][j] = 0;
			}
			if( i == 3 && j == 5 ) rmap[i][j] = 1;
		}
	}
	
	for( i = 1; i <= 170; i++ ){
		map[i] = new Array();
	}
	
	var x = 1, y = 1;
	for( i = 1; i <= map[0].height * 16; i += 16 ){
		x = 1;
		for( j = 1; j <= map[0].width * 24; j += 24 ){
			
			for( k = i; k < i + 16; k++ ){
				for( l = j; l < j + 24; l++ ){
					/* 지형 생성 */
					if( dbmap[ rmap[y][x] ][ k - i + 1 ][ l - j + 1 ] < 10 ){
						map[k][l] = dbmap[ rmap[y][x] ][ k - i + 1 ][ l - j + 1 ];
					}
					/* 적 생성 */
					else{
						if( Math.random()*100 <= 20 ){
							newEnemy( enemy, (l-1)*30, (k-1)*30, dbmap[ rmap[y][x] ][ k - i + 1 ][ l - j + 1 ]-10 );
						}
						map[k][l] = 0;
					}
					/* 테두리 생성 */
					if( k == map[0].height * 16 ) map[k][l] = 1;
					if( l == 1 ) map[k][l] = 1;
					if( l == map[0].width * 24 ) map[k][l] = 1;
				}
			}
			x++;
		}
		y++;
	}
	
	//newEnemy( enemy, 3240, 2337, 101 );
};

